import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Jumbotron(props) {
  return (
      <div className="jumbotron text-center">
          <h1>{props.title}</h1>
      </div>
  );
}

function Container(props) {
  return (
      <div className="container">
          {props.children}
      </div>
  );
}

function Card(props) {
  return (
      <div className='card'>
          <div className='card-body '>
              {props.children}
          </div>
      </div>
  );
}

function Col4(props) {
  return (
      <div className='col-4-sm'>
          {props.children}
      </div>
  );
}

function Row(props) {
  return (
      <div className='row'>
          {props.children}
      </div>
  );
}

function Greet(props) {
  return (
      <div>
          Hello {props.who}
      </div>
  );
}

function App(props) {
  return ( 
      <Container>
          <Jumbotron title='Hello 22-5KB'></Jumbotron>
          <Row>
              <Col4>
                  <Card>
                      <Greet who='22-5KB'></Greet>
                  </Card>
              </Col4>
          </Row>
      </Container>
  );
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
